function deleteStepsWithoutCaller(){Swal.fire({title:"Are you sure?",text:"Once deleted, you will not be able to recover this data!",icon:"warning",showCancelButton:!0,confirmButtonText:"Yes, delete it!",cancelButtonText:"No, cancel!",reverseButtons:!0}).then(e=>{var t;e.isConfirmed?(t=globalThis.selectedFlow.steps.filter((t,e,s)=>e===s.findIndex(e=>e.name===t.name)),globalThis.selectedFlow.steps=t,deleteProcessEffect()):e.dismiss===Swal.DismissReason.cancel&&Swal.fire("Cancelled","Your data is safe!","error")})}function deleteDuplicatedSteps(){Swal.fire({title:"Are you sure?",text:"Once deleted, you will not be able to recover this data!",icon:"warning",showCancelButton:!0,confirmButtonText:"Yes, delete it!",cancelButtonText:"No, cancel"}).then(e=>{var t;e.isConfirmed?(t=globalThis.selectedFlow.steps.filter((t,e,s)=>e===s.findIndex(e=>e.name===t.name)),globalThis.selectedFlow.steps=t,deleteProcessEffect()):e.dismiss!==Swal.DismissReason.cancel&&e.dismiss!==Swal.DismissReason.backdrop||Swal.fire("Cancelled","Your data is safe!","error")})}function deleteProcessEffect(){try{closePopup(),loader.style.display="block",setTimeout(()=>{renderGraph(),loader.style.display="none",Swal.fire("Poof! Your data has been deleted!","","success")},3e3)}catch(e){loader.style.display="none"}}